{"title": "JUST WATCHED"}
{"title": "'He was in a complete panic'"}
{"title": "Changes at Robinhood"}
{"body": "<section class=\"zn zn-body-text zn-body zn--idx-0 zn--ordinary zn-has-multiple-containers zn-has-29-containers\" data-eq-pts=\"xsmall: 0, medium: 460, large: 780, full16x9: 1100\" id=\"body-text\" data-vr-zone=\"zone-1-0\" data-zone-label=\"bodyText\" data-containers=\"29\" data-zn-id=\"body-text\"><div class=\"l-container\"><div class=\"el__leafmedia el__leafmedia--sourced-paragraph\"><p class=\"zn-body__paragraph speakable\" data-paragraph-id=\"paragraph_6372C7C4-DBFD-07B5-05DE-86E3D21F0D3E\"><cite class=\"el-editorial-source\">New York (CNN Business)</cite>Robinhood is being sued for the wrongful death of a 20-year-old college student who <a href=\"https://www.cnn.com/2020/06/19/business/robinhood-suicide-alex-kearns/index.html\" target=\"_blank\">died by suicide last summer </a>after he saw a negative balance of $730,000 in his trading account and mistakenly believed that was the sum of money he owed.</p></div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_794EBC97-1A49-9868-F556-871A38ED713C\">The parents and sister of Alexander Kearns accused <a href=\"http://www.cnn.com/2021/01/28/investing/robinhood-gamestop-reddit/index.html\" target=\"_blank\">Robinhood</a> of <a href=\"https://www.cnn.com/2020/12/16/business/robinhood-trading-app-complaint-massachusetts/index.html\" target=\"_blank\">luring inexperienced investors</a> like their son to <a href=\"https://www.cnn.com/2020/07/14/investing/robinhood-suicide-congress-underwood/index.html\" target=\"_blank\">take big risks in sophisticated financial instruments</a> such as the options trading he engaged in  -- without providing the necessary customer support and investment guidance.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_D242B175-4388-31FE-CD2C-871A38EE9CAA\">\"Robinhood built out its trading platform to look much like a videogame to attract young users and minimize the appearance of real-world risk,\" reads the lawsuit filed Monday in California by Kearns' parents Dan and Dorothy and sister Sydney. </div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_0DD7A095-4695-C643-2C95-871A38F0B0F5\">In addition to wrongful death, the complaint filed by the Illinois family accuses Robinhood of negligent infliction of emotional stress and unfair business practices. The damages they are seeking will be determined at a later date.</div><div class=\"ad ad--epic ad--mobile\" data-ad-text=\"show\"><div data-ad-id=\"ad_rect_atf_02\" data-ad-position=\"mobile\" data-ad-refresh=\"default\"><div id=\"ad_rect_atf_02\" class=\"ad-ad_rect_atf_02 ad-refresh-default\"></div></div></div><div class=\"ad ad--epic ad--tablet\" data-ad-text=\"show\"><div data-ad-id=\"ad_nat_btf_01\" data-ad-position=\"tablet\" data-ad-refresh=\"default\"></div></div><div class=\"ad ad--epic ad--desktop\" data-ad-text=\"show\"><div data-ad-id=\"ad_nat_btf_01\" data-ad-position=\"desktop\" data-ad-refresh=\"default\"></div></div><ul class=\"cn cn-list-hierarchical-xs cn--idx-5 cn-zoneAdContainer\" data-layout=\"list-hierarchical-xs\"></ul><div class=\"el__embedded el__embedded--standard\"><div class=\"el__storyelement--standard el__article--embed\"><div class=\"el__article--teaseimage\"><a href=\"/2021/02/04/investing/robinhood-ceo-vlad-tenev-finra/index.html\"><img class=\"media__image media__image--responsive\" alt=\"Robinhood&amp;#39;s CEO is not licensed by a powerful Wall Street regulator\" data-src-mini=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-small-169.jpg\" data-src-xsmall=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-medium-plus-169.jpg\" data-src-small=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-large-169.jpg\" data-src-medium=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-exlarge-169.jpg\" data-src-large=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-super-169.jpg\" data-src-full16x9=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-full-169.jpg\" data-src-mini1x1=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-small-11.jpg\" data-demand-load=\"not-loaded\" data-eq-pts=\"mini: 0, xsmall: 221, small: 308, medium: 461, large: 781\" src=\"data:image/gif;base64,R0lGODlhEAAJAJEAAAAAAP///////wAAACH5BAEAAAIALAAAAAAQAAkAAAIKlI+py+0Po5yUFQA7\"><div class=\"img__preloader\"></div><noscript><img alt=\"Robinhood&amp;#39;s CEO is not licensed by a powerful Wall Street regulator\" class=\"media__image\" src=\"//cdn.cnn.com/cnnnext/dam/assets/210127143329-robinhood-vladimir-tenev-file-large-169.jpg\"></noscript></a></div><div class=\"media__caption el__storyelement__title\"><span class=\"el__storyelement__header\"><a href=\"/2021/02/04/investing/robinhood-ceo-vlad-tenev-finra/index.html\">Robinhood's CEO is not licensed by a powerful Wall Street regulator</a></span></div></div></div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_964B2840-57F0-0C61-DF04-871E90F1DDA8\">\"Tragically, Robinhood's communications were completely misleading because, in reality, Alex did not owe any money,\" the lawsuit said. </div><div class=\"zn-body__read-more\"><div class=\"read-more-gradient\"></div><div class=\"read-more-button\" data-zjs=\"click\" data-zjs-campaign=\"readmore-btn-mobile\"><div class=\"read-more-link\" id=\"js-body-read-more\">Read More</div></div></div><div class=\"zn-body__read-all\"><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_97E48A88-0BB1-660C-468C-871A38F51505\">The tragedy illustrated the potential dangers of the free-trading boom set off in large part by Robinhood, which has enjoyed explosive growth during the pandemic. </div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_DE2E6D88-7E2C-5D19-95B4-871A38F76343\">Those risks have been further magnified recently with the<a href=\"http://www.cnn.com/2021/02/04/investing/gamestop-wallstreetbets-reddit/index.html\" target=\"_blank\"> rise and fall of GameStop</a>, which was catapulted by an army of traders on Reddit. <a href=\"http://www.cnn.com/2021/02/02/investing/robinhood-reddit-gamestop-elizabeth-warren/index.html\" target=\"_blank\">Robinhood sparked outrage</a> last month by <a href=\"http://www.cnn.com/2021/02/05/investing/robinhood-gamestop-amc-reddit/index.html\" target=\"_blank\">temporarily suspending</a> purchases of <span>GameStop</span> <span>(<span class=\"inlink_chart\"><a href=\"https://money.cnn.com/quote/quote.html?symb=GME&amp;source=story_quote_link\" class=\"inlink\">GME</a></span>)</span> -- a <a href=\"http://www.cnn.com/2021/02/01/investing/robinhood-gamestop-vlad-tenev/index.html\" target=\"_blank\">controversial step </a>that prompted Congress to schedule hearings. </div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_69055661-F37B-B456-3BCB-871A38FA69CC\">In a statement, Robinhood explained it has made a series of improvements to its options offering, including by providing guidance to help customers, updates on how it displays buying power and live voice support for customers with open options positions.</div><div class=\"el__leafmedia el__leafmedia--myfinance\"><div class=\"el__embedded el__embedded--partner el__embedded--myfinance\"><div id=\"cnn-end-of-content\" class=\"myFinance-widget\" data-campaign=\"cnnendofcontent\"></div></div></div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_DCEB400A-ED7D-4446-1A1D-871A38FB2773\">\"We were devastated by Alex Kearns' death,\" Robinhood said. \"We remain committed to making Robinhood a place to learn and invest responsibly.\"</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_80689141-1D14-0011-BA52-871E70D4569E\"><h3>'He was in a complete panic'</h3></div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_486010E7-4ABD-4E0C-61AC-871A38FD127D\">Kearns, who started using Robinhood when he was a senior in high school, died by suicide in June after placing an options spread trade containing a risk \"Alex did not understand,\" according to the lawsuit. His Robinhood account reflected a negative cash balance in the amount of $730,000 -- far more money than he had, the lawsuit said.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_BD961476-2969-8FCC-8F7A-871A38FFD306\">\"He was in a complete panic. His panic and desperation grew as he was unable to communicate over a number of hours with anyone at Robinhood,\" the lawsuit said, adding that he repeatedly tried and failed to reach out to representatives at the company.</div><div class=\"el__embedded el__embedded--standard\"><div class=\"el__storyelement--standard el__article--embed\"><div class=\"el__article--teaseimage\"><a href=\"/2021/02/04/investing/wall-street-robinhood-citadel-iex/index.html\"><img class=\"media__image media__image--responsive\" alt=\"High-speed trading firm linked to Robinhood is going to war with the SEC\" data-src-mini=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-small-169.jpg\" data-src-xsmall=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-medium-plus-169.jpg\" data-src-small=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-large-169.jpg\" data-src-medium=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-exlarge-169.jpg\" data-src-large=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-super-169.jpg\" data-src-full16x9=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-full-169.jpg\" data-src-mini1x1=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-small-11.jpg\" data-demand-load=\"not-loaded\" data-eq-pts=\"mini: 0, xsmall: 221, small: 308, medium: 461, large: 781\" src=\"data:image/gif;base64,R0lGODlhEAAJAJEAAAAAAP///////wAAACH5BAEAAAIALAAAAAAQAAkAAAIKlI+py+0Po5yUFQA7\"><div class=\"img__preloader\"></div><noscript><img alt=\"High-speed trading firm linked to Robinhood is going to war with the SEC\" class=\"media__image\" src=\"//cdn.cnn.com/cnnnext/dam/assets/210204082002-kenneth-griffin-brad-katsuyama-split-restricted-large-169.jpg\"></noscript></a></div><div class=\"media__caption el__storyelement__title\"><span class=\"el__storyelement__header\"><a href=\"/2021/02/04/investing/wall-street-robinhood-citadel-iex/index.html\">High-speed trading firm linked to Robinhood is going to war with the SEC</a></span></div></div></div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_E7B37528-A09F-6807-449E-871EAFF88898\">Adding to the tragedy, Kearns didn't realize his massive negative balance would have been erased by the exercise and settlement of options he held, the lawsuit said.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_1B809DAE-D065-A853-1A14-871A39038C57\">\"Robinhood never bothered to explain this to Alex or respond to his increasingly desperate pleas for help,\" the lawsuit said.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_68473A91-D817-D778-EBB9-871A39053782\">The family pinned the blame for Kearns' panic squarely on Robinhood.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_19759F06-3E1F-87ED-DA62-871A3907E6FE\">\"This resulted in a highly distressed mental condition in Alex, an uncontrollable impulse to commit suicide as the only option he could see,\" they said.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_EB50137B-791B-C2B9-F7B6-871EDD4326CF\"><h3>Changes at Robinhood</h3></div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_90790C61-51D6-E06E-0823-871A390AA0B7\">Before taking his own life, Kearns left a note that signaled his confusion.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_C5C4D8F3-9924-A1C6-2215-871A390C37DE\">\"How was a 20-year-old with no income able to get assigned almost $1 million worth of leverage,\" the note said, according to the lawsuit, adding that these were his last known written words. </div><div class=\"ad ad--epic ad--mobile\" data-ad-text=\"show\"><div data-ad-id=\"ad_rect_btf_01\" data-ad-position=\"mobile\" data-ad-refresh=\"default\"></div></div><ul class=\"cn cn-list-hierarchical-xs cn--idx-25 cn-zoneAdContainer\" data-layout=\"list-hierarchical-xs\"></ul><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_40ED08F3-3384-05B3-2CD8-871A3911ADA7\">After Kearns' death, Robinhood's co-founders wrote that they were \"personally devastated by this tragedy\" and promised to make improvements to its app.</div><div class=\"zn-body__paragraph\" data-paragraph-id=\"paragraph_D3D87499-9337-9F82-8BE1-871A3914721A\">Robinhood said this week that its changes include new financial criteria and revised experience requirements for new customers seeking to trade advanced options strategies and plans to expand that to other use cases. Robinhood also changed its system to escalate emailed support requests from some options traders. </div></div><p class=\"zn-body__paragraph zn-body__footer\"></p></div><div class=\"zn-body__read-more-outbrain\"><ul class=\"cn cn-list-hierarchical-small-horizontal cn--idx-0 cn-\" data-layout=\"list-hierarchical-small-horizontal\"><li><article class=\"cd cd--tool cd--tool__outbrain\" data-analytics=\"tool-type_list-hierarchical-small-horizontal_outbrain\" data-vr-contentbox=\"\" data-eq-pts=\"xsmall: 0, small: 300, medium: 460, large: 780\"><div class=\"OB_HOP_25 conditionalremove\"><div class=\"OUTBRAIN js-m-outbrain m-outbrain\" data-src=\"https://www.cnn.com/2021/02/09/investing/robinhood-lawsuit-suicide/index.html\" data-widget-id=\"HOP_25\" data-ob-template=\"cnn\"></div></div></article></li></ul></div></section>"}
